package com.a605.cse.audiosampler.dataobjects;/** * Created by might on 10/23/17. * Updated */public class AudioDataObject extends NetworkDataObject {    private final String TYPE = "Audio";    public static int counter;    private String sequenceNumber;    private String timestamp;    private String deviceId;    private AudioDataObject() {        this.sequenceNumber = String.valueOf(++counter);    }    public AudioDataObject(String _deviceId, String _timestamp) {        this();        this.deviceId = _deviceId;        this.timestamp = _timestamp;    }}